import React from 'react';
import CardStyled from '../styles/card_simple.tw';

const App = () => {
    return (
        <CardStyled>
            <img classNam="w-full" src="https://source.unsplash.com/random/500x250"/>
            <div className="px-6 py-4">
                <div className="font-bold text-xl mb-2">The beautiful image</div>
            </div>
        </CardStyled>
    );
}

export default App;
